import { useState } from 'react';
import { useEffect } from 'react/cjs/react.production.min';

function DisplaySimpson() {
  const [simpon, setSimpson] = useState();
  useEffect()
  axios
    .get('https://simpsons-quotes-api.herokuapp.com/quotes?count=num')
    .then((res) => {
      console.log(res);
      setSimpson({ simpsons: res.data });
    });

  return (
    <ul>
      {/* {simpon.map((simpson) => (
        <li>{simpson.character}</li>
      ))} */}
    </ul>
  );
}
export default DisplaySimpson;
